import { Axios } from './Axios';
import axios from 'axios';
import jwt_decode from 'jwt-decode';

const handleGetAllPokemons =()=>{
    return new Promise((resolve, reject)=>{
        axios.get('http://pokeapi.co/api/v2/pokemon/?limit=151')
            .then(pokemon =>{
                resolve(pokemon)
            })
            .catch((error)=>{
                reject(error)
            })
    })
}

export {
    handleGetAllPokemons
}
